  true,\n\t\"url\": null,\n\t\"notes\": \"Under this agreement the American Association
  of Motor Vehicles (AAMVA) will provide connectivity, billing services, and staff
  a help desk to the MVAs of States, District of Columbia, and territories of the
  US, for SSA. SSA will, through AAMVA's network, provide verification of certain
  voter registration information to the State MVAs for their use in the registration
  of voters for elections for Federal office. SSA is providing the verified information
  in accordance with the Help America Vote Act of 2002.\",\n\t\"license_title\": \"Other
